import React, { Fragment } from "react";

import "../Styles/seed.css";

export default function contentBox(props) {
  const { title, subtitle, text, className, children } = props;

  return (
    <Fragment>
      <div className={` ${className} h-pr-fl-ma w-a h-a b-s-b-b f-f-Gilroy`}>
        
      { title && <div className="h-pr-fl-ma b-s-b-b w-100 h-a" Style="font-size: 25px; font-weight:bold; line-height: 30px; color: white;"> {title}</div> }
      { subtitle && <div className="h-pr-fl-ma b-s-b-b w-100 h-a" Style="font-size: 15px; font-weight:bold; line-height: 20px; color: #666666;"> {subtitle}<br/><br/></div> }
      { text && <div className="h-pr-fl-ma b-s-b-b w-100 h-a"  Style="font-size: 15px; line-height: 20px; color: white;"> {text}</div> }

        {children}
      </div>
    </Fragment>
  );
}
